import React, { useEffect, useState } from "react";
import { Doughnut, Bar } from "react-chartjs-2";
import "./App.css";

export default function AnalyticsPage() {
  const [analytics, setAnalytics] = useState({ slots: [], summary: { statusCounts: {}, sensorCounts: {} } });
  const [showMode, setShowMode] = useState("top10");

  useEffect(() => {
    fetch("http://localhost:4000/api/analytics")
      .then(res => res.json())
      .then(setAnalytics);
  }, []);

  const { slots, summary } = analytics;

  // --- Sensor Status Logic ---
  // Working sensors = available + reserved slots
  const workingSensors = summary.sensorCounts?.working || 0;
  const outOfStatusSensors = summary.sensorCounts?.out_of_status || 0;

  // --- Prepare Top Slots for Bar Chart ---
  const topSlots = [...slots]
    .sort((a, b) => b.totalRevenue - a.totalRevenue)
    .slice(0, showMode === "top10" ? 10 : slots.length);

  // --- Chart Data: Sensor Status (Doughnut) ---
  const sensorDoughnutData = {
    labels: ["Working Properly", "Out of Status"],
    datasets: [{
      data: [workingSensors, outOfStatusSensors],
      backgroundColor: ["var(--primary)", "var(--error)"], // Your blue and red CSS variables
      borderWidth: 2,
    }],
  };

  // --- Chart Data: Top Slots (Bar) ---
  const barChartData = {
    labels: topSlots.map(slot => `Slot ${slot.id}`),
    datasets: [
      {
        label: "Bookings",
        data: topSlots.map(slot => slot.totalBookings),
        backgroundColor: "#1976d2",
        borderRadius: 6,
        maxBarThickness: 28,
      },
      {
        label: "Revenue (â‚¬)",
        data: topSlots.map(slot => slot.totalRevenue),
        backgroundColor: "#ff9800",
        borderRadius: 6,
        maxBarThickness: 28,
      },
    ],
  };

  // --- Chart Options ---
  const chartOptions = {
    plugins: { legend: { position: "bottom" } },
    responsive: true,
    maintainAspectRatio: false,
    scales: {
      x: {
        stacked: true,
        grid: { display: false },
        ticks: { autoSkip: true, maxRotation: 45, minRotation: 45 },
      },
      y: { beginAtZero: true, grid: { color: "#ccc" } },
    },
  };

  // --- Leaderboard Table Styling ---
  const statusBadge = (status) => (
    <span className={`status-badge status-${status}`}>
      {String(status).replaceAll("_", " ")}
    </span>
  );

  return (
    <div className="analytics-page">
      <div className="analytics-summary">
        <div className="summary-cards">
          <div className="summary-card">
            <span>Total Slots</span>
            <strong>{slots.length}</strong>
          </div>
        </div>
      </div>
      <div className="charts-section">
        {/* --- SENSOR HEALTH DOUGHNUT CHART --- */}
        <div className="chart-card">
          <h3>Slot Sensor Status</h3>
          <Doughnut
            data={sensorDoughnutData}
            options={{ plugins: { legend: { position: "bottom" } } }}
            height={280}
          />
        </div>
        {/* --- TOP SLOTS BAR CHART --- */}
        <div className="chart-card">
          <h3>
            Top Slots
            <span className="chart-mode-tabs">
              <button
                className={showMode === "top10" ? "active" : ""}
                onClick={() => setShowMode("top10")}
              >
                Top 10
              </button>
              <button
                className={showMode === "all" ? "active" : ""}
                onClick={() => setShowMode("all")}
              >
                All
              </button>
            </span>
          </h3>
          <div className="bar-chart-container" style={{ height: 340 }}>
            <Bar data={barChartData} options={chartOptions} />
          </div>
        </div>
      </div>
      <div className="leaderboard-section">
        <h3>Slot Leaderboard</h3>
        <table className="analytics-table">
          <thead>
            <tr>
              <th>Rank</th>
              <th>Slot ID</th>
              <th>Status</th>
              <th>Bookings</th>
              <th>Revenue (â‚¬)</th>
            </tr>
          </thead>
          <tbody>
            {topSlots.map((slot, i) => (
              <tr key={slot.id}>
                <td>{i + 1}</td>
                <td>{slot.id}</td>
                <td>{statusBadge(slot.status)}</td>
                <td>{slot.totalBookings}</td>
                <td>â‚¬{slot.totalRevenue}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
}
